import React from 'react'

export default function Chatbot() {
  return (
    <div>
        <div className='row'>
            <img
            src="https://www.google.com/imgres?q=chatbot&imgurl=https%3A%2F%2Fwww.cio.com%2Fwp-content%2Fuploads%2F2023%2F08%2Fchatbot_ai_machine-learning_emerging-tech-100778305-orig.jpg%3Fquality%3D50%26strip%3Dall&imgrefurl=https%3A%2F%2Fwww.cio.com%2Farticle%2F189347%2Fwhat-is-a-chatbot-simulating-human-conversation-for-service.html&docid=WirvErgmeKR0uM&tbnid=0QB4OTR6Xj3CfM&vet=12ahUKEwiCtbCG79GIAxUlTWwGHWYcPREQM3oECHoQAA..i&w=1200&h=800&hcb=2&ved=2ahUKEwiCtbCG79GIAxUlTWwGHWYcPREQM3oECHoQAA"
            alt="logo"
            height={200}
            width={200}
            />
        </div>
    </div>
  )
}
